import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Practice from './Practice';
import Sdata from './Sdata';
import App from './App';


ReactDOM.render( 

<>
{ Sdata.map((val) => {
    return(
    <Practice
    key={val.id}
    images={val.images} 
    />
  );
   })}

</>,


    document.getElementById('root'));
